import React from 'react';

const Sell = () => (
  <div style={{
    margin: '60px auto',
    maxWidth: 500,
    padding: '32px 24px',
    background: '#fff',
    borderRadius: '12px',
    boxShadow: '0 2px 12px rgba(10,42,102,0.08)',
    textAlign: 'center',
    fontSize: '1.25rem',
    color: '#0a2a66',
    fontWeight: 600
  }}>
    Contact <span style={{color:'#133b7c'}}>9599942400</span> to book inspection
  </div>
);

export default Sell;
